import { FC } from 'react';
import styles from './button.module.scss';

interface Props {
  text?: string;
  icon?: Element;
}

const Button: FC<Props> = ({ icon, text }) => {
  return (
    <div className={styles.collumsButtons}>
      <div className={styles.row}>
        <div className={styles.buttonGrup}>
          <button className={styles.button}>
            {icon && (
              <div className={styles.containerIcon}>
                <div className={styles.icon}>{icon}</div>
                {text && <div>{text}</div>}
              </div>
            )}
            {!icon && text && <div>{text}</div>}
          </button>
          <button className={styles.button}>
            {icon && (
              <div className={styles.containerIcon}>
                <div className={styles.icon}>{icon}</div>
                {text && <div>{text}</div>}
              </div>
            )}
            {!icon && text && <div>{text}</div>}
          </button>
        </div>
        <div className={styles.buttonGrup}>
          <button className={styles.button}>
            {icon && (
              <div className={styles.containerIcon}>
                <div className={styles.icon}>{icon}</div>
                {text && <div>{text}</div>}
              </div>
            )}
            {!icon && text && <div>{text}</div>}
          </button>
        </div>
      </div>
    </div>
  );
};

Button.defaultProps = {
  icon: null,
  text: '',
};

export default Button;
